/** @format */

import React, { useState } from "react";
import ReactDOM from "react-dom";
import { Layout, Menu } from "antd";
import Map from "./Components/Map";
import Input from "./Components/Inputs";
import {
	DesktopOutlined,
	PieChartOutlined,
	FileOutlined,
	TeamOutlined,
	UserOutlined,
} from "@ant-design/icons";
import reportWebVitals from "./reportWebVitals";
import "./index.css";
import "antd/dist/antd.css";

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

const Ant = () => {
	const [collapsed, setCollapsed] = useState(false);
	const [address, setAddress] = useState(
		`https://www.openstreetmap.org/export/embed.html?bbox=-91.40625000000001%2C-39.368279149160124%2C177.89062500000003%2C84.33698037639608&amp;layer=cyclemap`
	);
	const onCollapse = () => {
		setCollapsed(!collapsed);
		// console.log(collapsed);
	};

	return (
		<>
			<Layout className='body-main'>
				<Sider
					style={{ zIndex: 2 }}
					collapsible
					collapsed={collapsed}
					onCollapse={onCollapse}>
					<div className='logo' />
					<Menu
						theme='dark'
						defaultSelectedKeys={["1"]}
						mode='inline'>
						<Menu.Item key='1' icon={<PieChartOutlined />}>
							Option 1
						</Menu.Item>
						<Menu.Item key='2' icon={<DesktopOutlined />}>
							Option 2
						</Menu.Item>
						<SubMenu
							key='sub1'
							icon={<UserOutlined />}
							title='User'>
							<Menu.Item key='3'>Tom</Menu.Item>
							<Menu.Item key='4'>Bill</Menu.Item>
							<Menu.Item key='5'>Alex</Menu.Item>
						</SubMenu>
						<SubMenu
							key='sub2'
							icon={<TeamOutlined />}
							title='Team'>
							<Menu.Item key='6'>Team 1</Menu.Item>
							<Menu.Item key='8'>Team 2</Menu.Item>
						</SubMenu>
						<Menu.Item key='9' icon={<FileOutlined />}>
							Files
						</Menu.Item>
					</Menu>
				</Sider>
				<Layout className='site-layout'>
					<Header className='site-layout-background header-top'>
						<button
							className='btn'
							style={{
								position: "absolute",
								top: "0px",
								marginLeft: "0%",
							}}>
							Log In
						</button>
						<button
							className='btn'
							style={{
								position: "absolute",
								top: "0px",
								marginLeft: "8%",
							}}>
							Logout
						</button>
						<button
							className='btn'
							style={{
								position: "absolute",
								top: "0px",
								marginLeft: "87%",
							}}>
							Profile
						</button>
					</Header>

					<Content>
						<Map address={address} />
						<Input
							setAddress={setAddress}
						/>
					</Content>
					<Footer style={{ textAlign: "center" }}>
						By Aishwarya Agrawal
					</Footer>
				</Layout>
			</Layout>
		</>
	);
};

ReactDOM.render(<Ant />, document.getElementById("root"));

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
